column36:
Alan Jones talks with Prof. Thomas Borody about Ivermectin, a drug that
*  Is registered on the World Health Organisation’s List of Essential Medicines;
* has been safely used since 1975;
* is being used in trials in 30 countries;
* has been very effective in treating Covid-19;
* could be available in aged care homes immediately; and 
* costs $2 a pill. 
Prof  Borody has written to PM Morrison and premiere Andrews about this  a week ago and hasn’t had a response.
